import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './Contact.module.css'
import BannerHead from "../../img/blog_img.png";

let ContactItem1=() =>{
    return(
        <div className={classes.block}>
            <div className={classes.item_text}>
                <h1>blog</h1>
                <span className={classes.info}>
                    SparkleAppz, , an app development Indian company in Jodhpur, is a broad spectrum organization involved in creating world-class  <strong>custom application software &amp; website solutions.</strong> Our mission is to offer custom <strong> software solutions</strong>  and build niche market products that will allow the <a href="https://www.sparkleappz.com">company</a>  to deploy faster go to market solutions for its clients. We will be pleased to see in our network, We always care about our customer, and never let our customer worry about anything.</span>
                <button className={classes.btn}>
                    check out our portfolio
                </button>
            </div>
            <div className={classes.item_img}>
                <img src={BannerHead} alt=""/>
            </div>
        </div>
    );
};



const  Contact = () =>{
    return (
        <div className={classes.block}>
            <ContactItem1 />

        </div>
    );
};


export default Contact;
